import '../App.css';
import React from "react"
import {useState} from "react"



function SEARCHSTRING() {
 // const [search,setSearch] = useState(0)

 //const [btndisable,setBtndisable] = useState(true)

 const [input,setInput] = useState('')

 function getTextLength(text){
    let info = {}
    if (text) {
      info.textlength = text.length;
      info.text = text;
    }
    else {
      info.text = ' '
      info.textlength = 0 
    } 
    info.textlength > 0  ? info.isNullorEmpty = true : info.isNullorEmpty = false;

   return info;
  }
 
 function arm_Search() {

console.log(getTextLength(input).text)
  
  }

  return (
    <div className="search_div">
      
       <label htmlFor="armsearch" className = 'searchlbl'>поиск</label>
      <input type="text" id="armsearch"  value={input} onInput={e => setInput(e.target.value)} 
      
      placeholder="Введите данные по компании" />
      <button className="btnSearch btn-secondary" onClick = { arm_Search}>Найти</button>
     
    </div>
  )
}

export default SEARCHSTRING;
